at the dawn of post modernity, Doug Engelbart's [X-Y Position Indicator for a Display System] changed the way we interact with computers.     ![the first computer mouse prototype](https://www.sri.com/wp-content/uploads/layerslider/History-of-Innovation-Slider/mouse.jpg)   <pre><code>## the [mother of all demos]


&lt;figure markdown=""&gt;
&lt;figcaption markdown=""&gt;

Doug Englebart's [Mother of all Demos] presentation that changed computing forever.
&lt;/figcaption&gt;
&lt;iframe allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen="" frameborder="0" height="472" src="https://www.youtube.com/embed/yJDv-zdhzMY" title="The Mother of All Demos, presented by Douglas Engelbart (1968)" width="629"&gt;&lt;/iframe&gt;
&lt;/figure&gt;

&amp;gt; The live demonstration featured the introduction of a complete computer hardware and software system called
the oN-Line System or, more commonly, NLS. The 90-minute presentation demonstrated for the first time 
many of the fundamental elements of modern personal computing: &lt;b&gt;windows, hypertext, graphics, efficient navigation and command input, video conferencing, the computer mouse, word processing, dynamic file linking, revision control, and a collaborative real-time editor.&lt;/b&gt; Engelbart's presentation was the first to publicly demonstrate all of these elements in a single system. The demonstration was highly influential and spawned similar projects at Xerox PARC in the early 1970s. The underlying concepts and technologies influenced both the Apple Macintosh and Microsoft Windows graphical user interface operating systems in the 1980s and 1990s. 

